Sins of a Solar Empire is a science fiction real-time strategy computer game developed by Ironclad Games and published by Stardock Entertainment for Microsoft Windows computers. The game was released on February 4, 2008, and its first content expansion titled Entrenchment was released as a download on February 25, 2009. Sins is a real-time strategy (RTS) game that incorporates some elements from 4X strategy games; promotional materials describe it as &quot;RT4X.&quot;
